CREATE TABLE `batch_queue` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0 - input & pending to execute\n1 - worker lock \n2 - done by worker',
  `execute_at` datetime NOT NULL COMMENT '실행시간..',
  `type` tinyint(4) NOT NULL COMMENT '0 - not def\n1 - add white list when kyc result callback is green (user.status=5)\n2 - check register white list\n5 - kyc result callback mail to refer_key (user) depend on user.status (4/5)\n \n',
  `refer_key` int(11) NOT NULL,
  `worker` int(11) DEFAULT NULL,
  `reg_time` datetime NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `IDX_UNIQ_USER` (`refer_key`,`type`),
  KEY `IDX_QUERY` (`status`,`execute_at`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=latin1;
